import React from 'react'
import './skills.scss'

function Skills() { 
    return ( 
        <div className="container skillContainer"> 
            <h1>My skills</h1>
            <ul> 
                <li className="one">#WebTechnology</li> 
                <li className="rwo">#CompetitiveProblemSolving</li> 
                <li className="three">#WebDevelopment</li> 
                <li className="four">#OOP</li> 
                {/* <li>React & Redux</li>  */}
            </ul> 
            
        </div> 
    ) 
} 

export default Skills;
